-- ----------------------------
-- Procedure structure for P_Delete_DatRela_Bill
-- ----------------------------
DROP PROCEDURE [dbo].[P_Delete_DatRela_Bill]
GO



create procedure [dbo].[P_Delete_DatRela_Bill]
(
	@Bill_No int,
	@Bill_Man nvarchar(6),
	@En_Amount decimal(15, 2)
)
as
begin
	set nocount on
	
	declare @cnt int
	declare @relaid int
	declare @billamount decimal(15, 2)
	declare @ischeck bit
	
	select @relaid = relaid from ers.dbo.t_dat_rela_bill where billno = @Bill_No
	
	if (@relaid is not null)
	begin		
		select @ischeck = ischeck from ers.dbo.T_Dat_Rela where relaid = @relaid
		
		if (@ischeck = 1)
			raiserror('该票据已经进行过核对，不能删除！', 16, 1)
			
		delete from ers.dbo.t_dat_rela_bill where relaid = @relaid
		
		update ers.dbo.t_dat_bus set checkstatus = '1' where trankey in (select trankey from ers.dbo.t_dat_rela_sale where relaid = @relaid)
		
		update ers.dbo.t_dat_bank set checkstatus = '1' where trankey in (select trankey from ers.dbo.t_dat_rela_bank where relaid = @relaid)
		
		delete from ers.dbo.T_Dat_Rela where relaid = @relaid
		
		delete from ers.dbo.T_Dat_Rela_Bank where relaid = @relaid
		
		delete from ers.dbo.T_Dat_Rela_Sale where relaid = @relaid
		
		insert into ers.dbo.h_dat_cust (relaid,billno, trankey, manid, reladate, recouser, recodate) 
			select relaid,billno, trankey, manid, reladate, @Bill_Man, getdate() from ers.dbo.t_dat_cust where billno = @Bill_No
		
		delete from ers.dbo.t_dat_cust where billno = @Bill_No
	end
	
end




GO

-- ----------------------------
-- Procedure structure for P_Delete_DatRelaCust
-- ----------------------------
DROP PROCEDURE [dbo].[P_Delete_DatRelaCust]
GO



create procedure [dbo].[P_Delete_DatRelaCust]
(
	@billno int,
	@manid varchar(6)
)
as
begin 
	set nocount on
	declare @re23 varchar(25)
	declare @relaid int
	declare @cnt int
	declare @checkserial int
			
	select @cnt = count(*) from ers.dbo.t_chk_tran_bank where trankey in (select trankey from ers.dbo.t_dat_cust where billno = @billno)
	
	if (@cnt > 0)
		raiserror('已报账，不能被删除！', 16, 1)
		
	insert into ers.dbo.h_dat_cust (relaid,billno, trankey, manid, reladate, recouser, recodate) 
		select relaid,billno, trankey, manid, reladate, @manid, getdate() from ers.dbo.t_dat_cust where billno = @billno 	
	
	select @relaid = relaid from ers.dbo.t_dat_rela_bill where billno = @billno

	select trankey into #tmp_bank from ers.dbo.t_dat_rela_bank where relaid = @relaid	
			
	update ers.dbo.t_dat_bank set checkstatus = '1' where trankey in (select trankey from #tmp_bank)	
	
	delete from ers.dbo.t_dat_cust where billno = @billno
	
	delete from ers.dbo.t_dat_rela_bank where relaid = @relaid	
	
	update ers.dbo.t_dat_rela set bankamount = 0, bankcount = 0, bankdate = null, manid = '', ischeck = 0 where relaid = @relaid
	
	update t_bill_detail set bill_now_status = 11 where bill_no = @billno
	
	delete from ers.dbo.t_chk_serial where checkserial in (select a.checkserial from ers.dbo.t_chk_bank a, #tmp_bank b where a.trankey = b.trankey)
	
	delete from ers.dbo.t_chk_bus where checkserial in (select a.checkserial from ers.dbo.t_chk_bank a, #tmp_bank b where a.trankey = b.trankey)
	
	delete from ers.dbo.t_chk_bank where checkserial in (select a.checkserial from ers.dbo.t_chk_bank a, #tmp_bank b where a.trankey = b.trankey)
	
end




