create procedure [dbo].[P_Get_PrintInfoByBank]
(
	@Bank_ID smallint,
	@Bill_Type smallint,
	@Is_Half bit,
	@Bill_No int
)
as
begin
	set nocount on
	declare @deptid nvarchar(8)
	declare @deptflow smallint
	
	if (@Bill_Type = '3')
	begin
		select @deptid = dept_id from T_Bill_Detail where Bill_No = @Bill_No 
		
		select @deptflow = dept_flow from t_sys_dept_flow where dept_id = @deptid 
		
		if (@deptflow = 4)
			set @Bill_Type = '10'
	end
	
		select a.*, b.Bill_Type_Name, c.Bank_Name from T_Bill_Base_Format a, T_Bill_Type b, T_Bank c  
			where a.Bill_Type = b.Bill_Type and a.Bank_ID = c.Bank_ID and a.Bank_ID = @Bank_ID and a.Bill_Type = @Bill_Type and a.Is_Half = @Is_Half
			
		select a.*, b.Bill_Format_Name from T_Bill_Base_Format_Line a, T_Bill_Base_Format b where a.Bill_Format = b.Bill_Format and b.Bank_ID = @Bank_ID and b.Bill_Type = @Bill_Type and b.Is_Half = @Is_Half order by a.Line_Serial
		
		select a.*, b.Bill_Format_Name from T_Bill_Base_Format_Word a, T_Bill_Base_Format b where a.Bill_Format = b.Bill_Format and b.Bank_ID = @Bank_ID and b.Bill_Type = @Bill_Type and b.Is_Half = @Is_Half order by a.Word_Serial
		
		select a.*, b.Bill_Format_Name from T_Bill_Base_Format_Main a, T_Bill_Base_Format b where a.Bill_Format = b.Bill_Format and b.Bank_ID = @Bank_ID and b.Bill_Type = @Bill_Type and b.Is_Half = @Is_Half order by a.Main_Serial	
		
		select a.*, b.Oper_Type_Name from T_Bill_Detail a, T_Bill_Oper_Type b where a.Oper_Type = b.Oper_Type and a.Bill_No = @Bill_No 
