-- ----------------------------
-- Procedure structure for P_Insert_AutoCash
-- ----------------------------
DROP PROCEDURE [dbo].[P_Insert_AutoCash]
GO



create procedure [dbo].[P_Insert_AutoCash]
(
	@Man_ID nvarchar(6),
	@Work_Date nvarchar(8),
	@Reco_Date datetime
)
as
begin
	declare @Cnt int
	
	set @Cnt = (select count(*) from T_Bill_Auto_Cash where Man_ID = @Man_ID and Work_Date = @Work_Date)
	
	if (@Cnt = 0)		
	begin
		set @Cnt = (select count(*) from T_Bill_Day_Cash where Man_ID = @Man_ID and Day_Cash_Day = @Work_Date)
		
		if (@Cnt = 0)
		begin
			declare @Sum_Amount decimal(15, 2)
		
			set @Sum_Amount = (select sum(En_Amount) from T_Bill_Detail where Bill_Type = 3 and Bill_Now_Status = 0 and Bill_Man = @Man_ID and Bill_Status = 0 and Is_Print = 0 and Reco_Date < @Reco_Date)
		
			if (@Sum_Amount is null)
			begin
				set @Sum_Amount = 0
			end 
		
			select case when b.Day_Last is null then -@Sum_Amount else b.Day_Last - b.Back_Cash - @Sum_Amount end Sum_Last from T_Sys_Man a, T_Bill_Day_Cash b where a.Man_ID = @Man_ID and a.Man_ID = b.Man_ID and b.Day_Cash_Day = a.Pre_Work_Date
		end
	end
	else
	begin
		select 0 Sum_Last from T_Sys_Man where Man_ID = @Man_ID
	end 
end




GO

