-- ----------------------------
-- Procedure structure for P_Match_Bill
-- ----------------------------
DROP PROCEDURE [dbo].[P_Match_Bill]
GO



create procedure [dbo].[P_Match_Bill]
(
	@billno int,
	@first int
)
as
begin
	declare @relaid int
	declare @nowrelaid int
	declare @cnt int
	
	select @relaid = relaid from ers.dbo.t_dat_rela_bill where billno = @first
	
	select @nowrelaid = relaid from ers.dbo.t_dat_rela_bill where billno = @billno
	
	if (@first = @billno)
	begin
		delete from ers.dbo.t_dat_rela_bill where relaid = @relaid
		
		insert into ers.dbo.t_dat_rela_bill (relaid, billno, tranamount) select @relaid, @first, en_amount from t_bill_detail where bill_no = @first
	end
	else
	begin
		insert into ers.dbo.t_dat_rela_bill (relaid, billno, tranamount) select @relaid, @billno, en_amount from t_bill_detail where bill_no = @billno
		
		update ers.dbo.t_dat_rela_sale set relaid = @relaid where relaid = @nowrelaid 
		
		delete from ers.dbo.t_dat_rela_bill where billno = @billno
		
		select @cnt = count(*) from ers.dbo.t_dat_rela_bill where relaid = @nowrelaid 
		
		if (@cnt = 0)
		begin
			delete from t_dat_rela where relaid = @nowrelaid
		end
	end
	
	update ers.dbo.t_dat_bank set checkstatus = '1' where trankey in (select trankey from ers.dbo.t_dat_rela_bank where relaid = @nowrelaid)
	
	delete from ers.dbo.t_dat_rela_bank where relaid = @nowrelaid
	
end




GO

-- ----------------------------
-- Procedure structure for P_Match_Last
-- ----------------------------
DROP PROCEDURE [dbo].[P_Match_Last]
GO



create procedure [dbo].[P_Match_Last]
(
	@first int
)
as
begin
	declare @relaid int
	
	select @relaid = relaid from ers.dbo.t_dat_rela_bill where billno = @first
	
	declare @billcount int
	declare @billamount decimal(15, 2)
	declare @salecount int
	declare @Saleamount decimal(15, 2)
	declare @bankcount int
	declare @bankamount decimal(15, 2)
	
	select @billcount = count(*), @billamount = isnull(sum(b.en_amount), 0) from ers.dbo.t_dat_rela_bill a, t_bill_detail b 
		where a.billno = b.bill_no and a.relaid = @relaid
		
	select @salecount = count(*), @saleamount = isnull(sum(b.tranamount), 0) from ers.dbo.t_dat_rela_sale a, ers.dbo.t_dat_bus b 
		where a.trankey = b.trankey and a.relaid = @relaid
		
	select @bankcount = count(*), @bankamount = isnull(sum(b.trancredit), 0) from ers.dbo.t_dat_rela_bank a, ers.dbo.t_dat_bank b 
		where a.trankey = b.trankey and a.relaid = @relaid
		
	update ers.dbo.t_dat_rela set billcount = @billcount, billamount = @billamount, salecount = @salecount, Saleamount = @Saleamount, saledate = getdate(), 
		bankcount = @bankcount, bankamount = @bankamount, bankdate = getdate() where relaid = @relaid
		
	update ers.dbo.t_dat_bus set checkstatus = '2' where trankey in (select trankey from ers.dbo.t_dat_rela_sale where relaid = @relaid)
	
	update ers.dbo.t_dat_bank set checkstatus = '2' where trankey in (select trankey from ers.dbo.t_dat_rela_bank where relaid = @relaid)
end




GO

