create procedure [dbo].[P_ReDept_BillBackCash]
(
	@Serial_ID int out,
	@Tran_ID nvarchar(20),
	@Now_Man nvarchar(6) = null,
	@Now_Man_Name nvarchar(10) = null,
	@Now_Date datetime = null,
	@Now_Desc nvarchar(100) = null,
	@BackCash_Status smallint = null,
	@BackCash_Flow smallint = null,
	@Next_Man nvarchar(6) = null,
	@Next_Man_Name nvarchar(10) = null,
	@Next_Flow smallint = null,
	@BackCash_Cash decimal(15, 2) = null,
	@Action smallint
)
as
begin
	if @Action = 0
	begin
		insert into T_Bill_BackCash_Check (Tran_ID, Now_Man, Now_Man_Name, Now_Date, Now_Desc, Audit_Money, BackCash_Status, BackCash_Flow) 
			values (@Tran_ID, @Now_Man, @Now_Man_Name, getdate(), @Now_Desc, 0, @BackCash_Status, @BackCash_Flow)
			
		set @Serial_ID = (select @@IDENTITY)
		
		declare @Apply_Man nvarchar(6)
		
		set @Apply_Man = (select Apply_Man from T_Bill_BackCash where Tran_ID = @Tran_ID)
		
		update T_Sys_Man set Back_Cash = Back_Cash + @BackCash_Cash where Man_ID = @Apply_Man
	end
	else
	begin
		update T_Bill_BackCash_Check set 
			Now_Date = getdate(),
			BackCash_Status = @BackCash_Status,
			Now_Desc = @Now_Desc, 
			BackCash_Flow = @BackCash_Flow where Serial_ID = @Serial_ID
	end
	
	update T_Bill_BackCash set  
			BackCash_Status = @BackCash_Status,
			Serial_ID = @Serial_ID, 
			Next_Man = @Next_Man,
			Next_Man_Name = @Next_Man_Name, 
			Next_Flow = @Next_Flow 
		where Tran_ID = @Tran_ID	
end




