-- ----------------------------
-- Procedure structure for P_Rpt_Analysis
-- ----------------------------
DROP PROCEDURE [dbo].[P_Rpt_Analysis]
GO



create procedure [dbo].[P_Rpt_Analysis]
(
	@Search nvarchar(300) = null,
	@Man_ID nvarchar(6) = null
)
as
begin
	declare @Sql nvarchar(4000)
	
	declare @Tran_ID nvarchar(20)
	
	exec dbo.P_Create_TranID @Tran_ID output, @Man_ID
	
	if (patindex('%Dept_PID%', @Search) > 0)
	begin
		exec ('select a.Bill_No, a.Bill_Type, c.Bill_Type_Name, a.Act_Bill_No, a.Re_02, a.En_Amount, b.Man_Name, b.Get_Date, b.Bill_Now_Status into T' 
			+ @Tran_ID + ' from T_Bill_Detail a, T_Bill_Get b, T_Bill_Type c, T_Sys_Dept_Tree i where a.Bill_Type in (2, 5, 6) '
			+ 'and a.Bill_No = b.Bill_No and a.Bill_Status = 0 and a.Bill_Type = c.Bill_Type and a.Dept_ID = i.Dept_ID ' + @Search);
	end
	else
	begin
		exec ('select a.Bill_No, a.Bill_Type, c.Bill_Type_Name, a.Act_Bill_No, a.Re_02, a.En_Amount, b.Man_Name, b.Get_Date, b.Bill_Now_Status into T' 
			+ @Tran_ID + ' from T_Bill_Detail a, T_Bill_Get b, T_Bill_Type c where a.Bill_Type in (2, 5, 6) and a.Bill_No = b.Bill_No and a.Bill_Status = 0 and a.Bill_Type = c.Bill_Type ' + @Search);	
	end
		
	exec ('select a.Bill_No, a.Bill_Type_Name, a.Act_Bill_No, a.Re_02, a.En_Amount, Man_Name_6, Get_Date_6, case when Get_Date_5 is null then datediff(hh, Get_Date_6, getdate()) else datediff(hh, Get_Date_6, Get_Date_5) end Diff_Date_6, ' + 
	'Man_Name_5, Get_Date_5, case when Get_Date_7 is null then datediff(hh, Get_Date_5, getdate()) else datediff(hh, Get_Date_5, Get_Date_7) end Diff_Date_5, ' + 
	'Man_Name_7, Get_Date_7, case when Get_Date_8 is null then datediff(hh, Get_Date_7, getdate()) else datediff(hh, Get_Date_7, Get_Date_8) end Diff_Date_7, ' + 
	'Man_Name_8, Get_Date_8, case when Get_Date_50 is null then 0 else datediff(hh, Get_Date_8, Get_Date_50) end Diff_Date_8, ' + 
	'Man_Name_50, Get_Date_50, case when Get_Date_52 is null then datediff(hh, Get_Date_50, getdate()) else datediff(hh, Get_Date_50, Get_Date_52) end Diff_Date_50, ' + 
	'Man_Name_52, Get_Date_52 from ' + 
	'(select Bill_No, Bill_Type_Name, Act_Bill_No, Re_02, En_Amount, Man_Name Man_Name_6, Get_Date Get_Date_6 from T' + @Tran_ID + ' where Bill_Now_Status = 6) a ' + 
	' left join (select a2.Bill_No, a2.Man_Name  Man_Name_5, a2.Get_Date Get_Date_5 from (select Bill_No, min(Get_Date) Get_Date from T' + @Tran_ID + ' where Bill_Now_Status = 5  group by Bill_No) a1, T' + @Tran_ID + ' a2 where a2.Bill_Now_Status = 5 and a1.Bill_No = a2.Bill_No and a1.Get_Date = a2.Get_Date) b on a.Bill_No = b.Bill_No ' +
	' left join (select a21.Bill_No, a21.Man_Name  Man_Name_7, a21.Get_Date Get_Date_7 from (select Bill_No, max(Get_Date) Get_Date from T' + @Tran_ID + ' where Bill_Now_Status = 7  group by Bill_No) a11, T' + @Tran_ID + ' a21 where a21.Bill_Now_Status = 7 and a11.Bill_No = a21.Bill_No and a11.Get_Date = a21.Get_Date) c on a.Bill_No = c.Bill_No ' +
	' left join (select Bill_No, Man_Name  Man_Name_8, Get_Date Get_Date_8 from T' + @Tran_ID + ' where Bill_Now_Status = 8) d on a.Bill_No = d.Bill_No ' +
	' left join (select Bill_No, Man_Name  Man_Name_50, Get_Date Get_Date_50 from T' + @Tran_ID + ' where Bill_Now_Status = 50) e on a.Bill_No = e.Bill_No ' +
	' left join (select Bill_No, Man_Name  Man_Name_52, Get_Date Get_Date_52 from T' + @Tran_ID + ' where Bill_Now_Status = 52) f on a.Bill_No = f.Bill_No  ' + 
	' order by a.Bill_No ');
	
	if (@@ERROR <> 0)
		goto error_deal
		
error_deal:
	if exists (select 1 from  sysobjects where  id = object_id('T' + @Tran_ID) and type = 'U')
	begin
   	exec ('drop table T' + @Tran_ID)
  end

end



GO

