create procedure [dbo].[P_Rpt_DayCash]
(
	@Search nvarchar(300)
)
as
begin
	declare @Sql nvarchar(1000)
	
	set @Search = replace(@Search, 'a.Day_Cash_Day =', 'a.Day_Cash_Day <=')
	
	if (patindex('%Dept_PID%', @Search) > 0)
	begin
	set @Sql = 'select a.Man_Name, a.Day_Cash_Day, b.Dept_Name, a.Day_Last, a.Back_Cash, a.Day_Cash, a.Day_Bank, a.Before_Last '
		+ 'from T_Bill_Day_Cash a, T_Sys_Dept b, (select a.Man_ID, max(a.Day_Cash_Day) Day_Cash_Day from T_Bill_Day_Cash a, T_Sys_Dept b, T_Sys_Dept_Tree c '
		+ 'where a.Dept_ID = b.Dept_ID and a.Dept_ID = c.Dept_ID '+ @Search  + ' group by a.Man_ID) c '
		+ 'where a.Dept_ID = b.Dept_ID and a.Man_ID = c.Man_ID and a.Day_Cash_Day = c.Day_Cash_Day ' + 
		+ 'order by a.Dept_ID, a.Day_Cash_Day desc, a.Man_ID'
	end
	else
	begin
	set @Sql = 'select a.Man_Name, a.Day_Cash_Day, b.Dept_Name, a.Day_Last, a.Back_Cash, a.Day_Cash, a.Day_Bank, a.Before_Last '
		+ 'from T_Bill_Day_Cash a, T_Sys_Dept b, (select a.Man_ID, max(a.Day_Cash_Day) Day_Cash_Day from T_Bill_Day_Cash a, T_Sys_Dept b where a.Dept_ID = b.Dept_ID '
		+ @Search  + ' group by a.Man_ID) c '
		+ 'where a.Dept_ID = b.Dept_ID and a.Man_ID = c.Man_ID and a.Day_Cash_Day = c.Day_Cash_Day ' + 
		+ 'order by a.Dept_ID, a.Day_Cash_Day desc, a.Man_ID'
	end
	
	exec(@Sql)
end




