-- Procedure structure for P_Save_DatRela_Bill
-- ----------------------------
DROP PROCEDURE [dbo].[P_Save_DatRela_Bill]
GO



create procedure [dbo].[P_Save_DatRela_Bill]
(
	@Bill_No int,
	@Bill_Man nvarchar(6),
	@En_Amount decimal(15, 2)
)
as
begin
	set nocount on
	
	declare @cnt int
	declare @relaid int
	declare @billamount decimal(15, 2)
	declare @re23 varchar(25)
	
	select @relaid = relaid from ers.dbo.T_Dat_Rela_Bill where billno = @Bill_No
	
	if (@relaid is not null)
	begin		
		update ers.dbo.T_Dat_Rela_Bill set tranamount = @En_Amount where relaid = @relaid and billno = @Bill_No 
		
		select @billamount = isnull(sum(a.tranamount), 0), @cnt = count(*) from ers.dbo.T_Dat_Rela_Bill a where a.relaid = @relaid 
		
		update ers.dbo.t_dat_rela set billamount = @billamount, billcount = @cnt, billdate = getdate() where relaid = @relaid
	end
	else
	begin 					
		--update ers.dbo.t_dat_bus set checkstatus = '1' where trankey in (select trankey from ers.dbo.t_dat_cust where billno = @Bill_No )
		
		delete from ers.dbo.t_dat_rela_sale where billno = @Bill_No 
		
		insert into ers.dbo.T_Dat_Rela (billcount, billamount, billdate, bankcount, bankamount, bankdate, salecount, saleamount, saledate, isauto, isbill, manid, ischeck) 
			values (1, @En_Amount, getdate(), 0, 0, null, 0, 0, null, 1, 1, '', 0)
				
		select @relaid = @@IDENTITY
		
		insert into ers.dbo.t_dat_rela_bill (relaid, billno, tranamount) values (@relaid, @Bill_No, @En_Amount)
		
		insert into ers.dbo.t_dat_rela_sale (relaid, billno, trankey, tranamount) select @relaid, @Bill_No, trankey, tranamount from ers.dbo.t_dat_bus where nowbillno = @Bill_No
		
		--update ers.dbo.t_dat_bus set checkstatus = '2' where nowbillno = @Bill_No
		
		select @billamount = isnull(sum(a.tranamount), 0), @cnt = count(*) from ers.dbo.t_dat_bus a where nowbillno = @Bill_No
		
		if (@cnt > 0)
			update ers.dbo.t_dat_rela set saleamount = @billamount, salecount = @cnt, saledate = getdate() where relaid = @relaid
	end
	
end




