			'c.Bill_Type_Name, d.Bank_Name, e.Oper_Type_Name, b.Dept_Name ' + 
			'from T_Bill_Detail a, T_Sys_Dept b, T_Bill_Type c, T_Bank d, T_Bill_Oper_Type e, ers.dbo.t_dat_rela a1, ers.dbo.t_dat_rela_bill a2  ' + 
			'where a.Bill_Status = 0 and a.Bill_Type = c.Bill_Type and a.Bank_ID = d.Bank_ID and a.Oper_Type = e.Oper_Type and a.Dept_ID = b.Dept_ID ' + 
			'and a.bill_no = a2.billno and a1.relaid = a2.relaid) a, T_Sys_Dept_Tree i where a.Check_Flag = ''未对应'' and a.Dept_ID = i.Dept_ID  ' + @Search + ' order by a.Bill_No desc'
	end
	else
	begin
		set @Sql = 'select a.* from (select case when a1.billamount = a1.saleamount then ''已对应'' else ''未对应'' end Check_Flag, a.*, ' +
			'c.Bill_Type_Name, d.Bank_Name, e.Oper_Type_Name, b.Dept_Name ' + 
