	begin
	set @Sql = 'select a.*, d.Bank_Name, e.Oper_Type_Name, b.Dept_Name, c.Now_Status_Name, g.Man_Name Now_Man_Name, h.Dept_Name Now_Dept_Name, ' + 
		'case when a.Bill_Now_Status = 8 then 0 when a.Bill_Now_Status = 10 then 0 else datediff(hh, g.Get_Date, getdate()) end Now_Days  ' +
		'from T_Bill_Detail a, T_Sys_Dept b, T_Bank d, T_Bill_Oper_Type e, T_Bill_Now_Status c, T_Bill_Get g, T_Sys_Dept h, T_Sys_Dept_Tree i ' + 
		'where a.Bill_Status = 0 and a.Bill_Type = 3 and a.Bank_ID = d.Bank_ID and a.Oper_Type = e.Oper_Type and a.Dept_ID = b.Dept_ID ' +
		'and a.Bill_Now_Status = c.Now_Status and a.Bill_No = g.Bill_No and g.Is_Get = 1 and g.Dept_ID = h.Dept_ID and a.Dept_ID = i.Dept_ID ' + @Search + ' order by a.Bill_No desc'
	end
	else
	begin
	set @Sql = 'select a.*, d.Bank_Name, e.Oper_Type_Name, b.Dept_Name, c.Now_Status_Name, g.Man_Name Now_Man_Name, h.Dept_Name Now_Dept_Name, ' + 
		'case when a.Bill_Now_Status = 8 then 0 when a.Bill_Now_Status = 10 then 0 else datediff(hh, g.Get_Date, getdate()) end Now_Days  ' +
		'from T_Bill_Detail a, T_Sys_Dept b, T_Bank d, T_Bill_Oper_Type e, T_Bill_Now_Status c, T_Bill_Get g, T_Sys_Dept h ' + 
		'where a.Bill_Status = 0 and a.Bill_Type = 3 and a.Bank_ID = d.Bank_ID and a.Oper_Type = e.Oper_Type and a.Dept_ID = b.Dept_ID ' +
		'and a.Bill_Now_Status = c.Now_Status and a.Bill_No = g.Bill_No and g.Is_Get = 1 and g.Dept_ID = h.Dept_ID  ' + @Search + ' order by a.Bill_No desc'
	end
	
	exec(@Sql)
			
end



