create procedure [dbo].[P_Search_FireStove]
(
	@Search nvarchar(1000),
	@SearchNow nvarchar(1000) = null
)
as
begin
	declare @Sql nvarchar(2000)
	
	if @SearchNow is null
	begin
	set @Sql = 'select a.*, b.Stove_In, b.Stove_Out, b.Stove_ID, c.Stove_Name, d.Ashes_Type_Name, b.Number, b.Number_Date ' +
		'from V_Select_Fire_Stove a left join T_Pmt_Ashes_Type d on a.Ashed_Type = d.Ashes_Type, T_Bus_Fire b left join T_Pmt_Bus_Stove c on b.Stove_ID = c.Stove_ID where a.Tran_ID = b.Tran_ID ' + @Search + 
		' order by b.Number_Date desc, b.Number, b.Stove_ID, b.Stove_In desc, b.Stove_Out, a.Hall_Date, a.Hall_Round_Name, a.Tran_Date'
	end
	else
	begin
	set @Sql = 'select * from ((select a.*, b.Stove_In, b.Stove_Out, b.Stove_ID, c.Stove_Name, h.Ashes_Type_Name, b.Number, b.Number_Date ' +
		'from V_Select_Fire_Stove a left join T_Pmt_Ashes_Type h on a.Ashed_Type = h.Ashes_Type, T_Bus_Fire b left join T_Pmt_Bus_Stove c on b.Stove_ID = c.Stove_ID where a.Tran_ID = b.Tran_ID ' + @Search + 
		') union ( select d.*, e.Stove_In, e.Stove_Out, e.Stove_ID, f.Stove_Name, j.Ashes_Type_Name, e.Number, e.Number_Date ' + 
		'from V_Select_Fire_StoveNow d left join T_Pmt_Ashes_Type j on d.Ashed_Type = j.Ashes_Type, T_Bus_Fire e left join T_Pmt_Bus_Stove f on e.Stove_ID = f.Stove_ID where d.Tran_ID = e.Tran_ID ' + @SearchNow + 
		')) g order by g.Number_Date desc, g.Number,  g.Stove_ID, g.Stove_In desc, g.Stove_Out, g.Hall_Date, g.Hall_Round_Name, g.Tran_Date'
	end
	exec(@Sql)
end



