create procedure [dbo].[P_Search_NoBillBack]
(
	@Search nvarchar(300)
)
as
begin
	declare @Sql nvarchar(1000)
	
	if (patindex('%a.Bill_Man%', @Search) > 0)
	begin
		set @Search = replace(@Search, 'a.Bill_Man', 'i.Man_ID')
	end
	
	if (patindex('%Dept_PID%', @Search) > 0)
	begin
	set @Sql = 'select a.Bill_No, a.Act_Bill_No, a.Oper_Type, a.En_Amount, a.Bill_Date, a.Bill_Man, a.Bill_Man_Name, c.Bill_Type_Name, ' + 
			'd.Bank_Name, e.Oper_Type_Name, b.Dept_Name, g.Man_Name Reco_Man_Name, f.Back_Date, f.Back_Reason, f.Reco_Man, f.Reco_Date, f.FeedBack_Date ' + 
			'from T_Bill_Detail a, T_Sys_Dept b, T_Bill_Type c, T_Bank d, T_Bill_Oper_Type e, T_Bill_Back f, T_Sys_Man g, T_Sys_Dept_Tree h, T_Bill_Get i ' + 
			'where a.Bill_Status = 0 and a.Bill_Type = c.Bill_Type and a.Bank_ID = d.Bank_ID and a.Oper_Type = e.Oper_Type and a.Dept_ID = b.Dept_ID ' +
			'and a.Bill_No = f.Bill_No and f.Reco_Man = g.Man_ID and f.Is_FeedBack = 0 and a.Dept_ID = h.Dept_ID and a.Bill_No = i.Bill_No and i.Is_Get = 1  ' + @Search + ' order by a.Bill_No desc'
	end
	else
	begin
	set @Sql = 'select a.Bill_No, a.Act_Bill_No, a.Oper_Type, a.En_Amount, a.Bill_Date, a.Bill_Man, a.Bill_Man_Name, c.Bill_Type_Name, ' + 
			'd.Bank_Name, e.Oper_Type_Name, b.Dept_Name, g.Man_Name Reco_Man_Name, f.Back_Date, f.Back_Reason, f.Reco_Man, f.Reco_Date, f.FeedBack_Date ' + 
			'from T_Bill_Detail a, T_Sys_Dept b, T_Bill_Type c, T_Bank d, T_Bill_Oper_Type e, T_Bill_Back f, T_Sys_Man g, T_Bill_Get i ' + 
			'where a.Bill_Status = 0 and a.Bill_Type = c.Bill_Type and a.Bank_ID = d.Bank_ID and a.Oper_Type = e.Oper_Type and a.Dept_ID = b.Dept_ID ' +
			'and a.Bill_No = f.Bill_No and f.Reco_Man = g.Man_ID and f.Is_FeedBack = 0 and a.Bill_No = i.Bill_No and i.Is_Get = 1 ' + @Search + ' order by a.Bill_No desc'
	end
	exec(@Sql)
			
end




