-- ----------------------------
-- Procedure structure for P_Search_OverTime
-- ----------------------------
DROP PROCEDURE [dbo].[P_Search_OverTime]
GO



create procedure [dbo].[P_Search_OverTime]
(
	@Search nvarchar(300)
)
as
begin
	
	declare @Sql nvarchar(1000)
	
	if (patindex('%En_Date%', @Search) > 0)
	begin
		if (patindex('%Dept_PID%', @Search) > 0)
		begin
		set @Sql = 'select a.*, c.Bill_Type_Name, d.Bank_Name, e.Oper_Type_Name, b.Dept_Name, f.Now_Status_Name, g.Man_Name Over_Man_Name, g.Now_Days, g.Get_Date, i.Man_Type_Name '
			+ 'from T_Bill_Detail a, T_Sys_Dept b, T_Bill_Type c, T_Bank d, T_Bill_Oper_Type e, T_Bill_Now_Status f, V_Select_Step_Over g, T_Sys_Dept_Tree h, T_Pmt_Man_Type i '
			+ 'where a.Bill_Type = c.Bill_Type and a.Bank_ID = d.Bank_ID and a.Oper_Type = e.Oper_Type '
			+ 'and g.Dept_ID = b.Dept_ID and a.Bill_Now_Status = f.Now_Status and g.Now_Days > 90 and a.Bill_Status = 0 and a.Man_Type = i.Man_Type '
			+ 'and a.Bill_No = g.Bill_No and g.Dept_ID = h.Dept_ID ' + @Search + ' order by g.Bill_No desc '
		end
		else
		begin
		set @Sql = 'select a.*, c.Bill_Type_Name, d.Bank_Name, e.Oper_Type_Name, b.Dept_Name, f.Now_Status_Name, g.Man_Name Over_Man_Name, g.Now_Days, g.Get_Date, i.Man_Type_Name '
			+ 'from T_Bill_Detail a, T_Sys_Dept b, T_Bill_Type c, T_Bank d, T_Bill_Oper_Type e, T_Bill_Now_Status f, V_Select_Step_Over g, T_Pmt_Man_Type i '
			+ 'where a.Bill_Type = c.Bill_Type and a.Bank_ID = d.Bank_ID and a.Oper_Type = e.Oper_Type and a.Bill_Status = 0 and a.Man_Type = i.Man_Type '
			+ 'and g.Dept_ID = b.Dept_ID and a.Bill_Now_Status = f.Now_Status and g.Now_Days > 90 '
			+ 'and a.Bill_No = g.Bill_No ' + @Search + ' order by g.Bill_No desc '
		end
	end
	else
	begin
		declare @Now_Date datetime
		set @Now_Date = (select getdate())
		set @Now_Date = dateadd(mm, -1, @Now_Date)
		
		if (patindex('%Dept_PID%', @Search) > 0)
		begin
		set @Sql = 'select a.*, c.Bill_Type_Name, d.Bank_Name, e.Oper_Type_Name, b.Dept_Name, f.Now_Status_Name, g.Man_Name Over_Man_Name, g.Now_Days, g.Get_Date, i.Man_Type_Name '
			+ 'from T_Bill_Detail a, T_Sys_Dept b, T_Bill_Type c, T_Bank d, T_Bill_Oper_Type e, T_Bill_Now_Status f, V_Select_Step_Over g, T_Sys_Dept_Tree h, T_Pmt_Man_Type i '
			+ 'where a.Bill_Type = c.Bill_Type and a.Bank_ID = d.Bank_ID and a.Oper_Type = e.Oper_Type '
			+ 'and g.Dept_ID = b.Dept_ID and a.Bill_Now_Status = f.Now_Status and g.Now_Days > 90 and a.Bill_Status = 0 and a.Man_Type = i.Man_Type and a.Bill_Now_Status !=8 and a.Bill_Now_Status != 52 '
			+ 'and a.Bill_No = g.Bill_No and g.Dept_ID = h.Dept_ID and a.En_Date >= ''' + convert(nvarchar(10), @Now_Date, 121) + ' 00:00:00'' ' + @Search + ' order by g.Bill_No desc '
		end
		else
		begin
		set @Sql = 'select a.*, c.Bill_Type_Name, d.Bank_Name, e.Oper_Type_Name, b.Dept_Name, f.Now_Status_Name, g.Man_Name Over_Man_Name, g.Now_Days, g.Get_Date, i.Man_Type_Name '
			+ 'from T_Bill_Detail a, T_Sys_Dept b, T_Bill_Type c, T_Bank d, T_Bill_Oper_Type e, T_Bill_Now_Status f, V_Select_Step_Over g, T_Pmt_Man_Type i '
			+ 'where a.Bill_Type = c.Bill_Type and a.Bank_ID = d.Bank_ID and a.Oper_Type = e.Oper_Type and a.Bill_Status = 0 and a.Man_Type = i.Man_Type and a.Bill_Now_Status !=8 and a.Bill_Now_Status != 52 '
			+ 'and g.Dept_ID = b.Dept_ID and a.Bill_Now_Status = f.Now_Status and g.Now_Days > 90 '
			+ 'and a.Bill_No = g.Bill_No and a.En_Date >= ''' + convert(nvarchar(10), @Now_Date, 121) + ' 00:00:00'' ' + @Search + ' order by g.Bill_No desc '
		end
	end
	exec(@Sql)			
end




GO

