DROP PROCEDURE [dbo].[P_Search_SelfBillGet]
GO



create procedure [dbo].[P_Search_SelfBillGet]
(
	@Search nvarchar(300)
)
as
begin
	declare @Sql nvarchar(1000)
	
	if (patindex('%Dept_PID%', @Search) > 0)
	begin
	set @Sql = 'select a.*, g.Get_Date, c.Bill_Type_Name, d.Bank_Name, e.Oper_Type_Name, b.Dept_Name, f.Now_Status_Name, '
		+ 'case when a.Bill_Now_Status = 8 then 0 else datediff(hh, g.Get_Date, getdate()) end Now_Days '
		+ 'from T_Bill_Detail a, T_Sys_Dept b, T_Bill_Type c, T_Bank d, T_Bill_Oper_Type e, T_Bill_Now_Status f, T_Bill_Get g, T_Sys_Dept_Tree h '
		+ 'where a.Bill_Status = 0 and a.Bill_Type = c.Bill_Type and a.Bank_ID = d.Bank_ID and a.Oper_Type = e.Oper_Type and '
		+ 'g.Dept_ID = b.Dept_ID and a.Bill_Now_Status = f.Now_Status and g.Dept_ID = h.Dept_ID  '
		+ 'and a.Bill_No = g.Bill_No and g.Is_Get = 1 ' + @Search + ' order by g.Get_Date desc '
	end
	else
	begin
	set @Sql = 'select a.*, g.Get_Date, c.Bill_Type_Name, d.Bank_Name, e.Oper_Type_Name, b.Dept_Name, f.Now_Status_Name, '
		+ 'case when a.Bill_Now_Status = 8 then 0 else datediff(hh, g.Get_Date, getdate()) end Now_Days '
		+ 'from T_Bill_Detail a, T_Sys_Dept b, T_Bill_Type c, T_Bank d, T_Bill_Oper_Type e, T_Bill_Now_Status f, T_Bill_Get g '
		+ 'where a.Bill_Status = 0 and a.Bill_Type = c.Bill_Type and a.Bank_ID = d.Bank_ID and a.Oper_Type = e.Oper_Type and '
		+ 'g.Dept_ID = b.Dept_ID and a.Bill_Now_Status = f.Now_Status '
		+ 'and a.Bill_No = g.Bill_No and g.Is_Get = 1 ' + @Search + ' order by g.Get_Date desc '
	end
	
	exec(@Sql)
end




