-- ----------------------------
-- Procedure structure for P_Tmp_BJ
-- ----------------------------
DROP PROCEDURE [dbo].[P_Tmp_BJ]
GO



create procedure [dbo].[P_Tmp_BJ]
as
begin
	set nocount on
	
	select a.*, b.bill_no newbillno into #tmp_detail_xj from ers.dbo.t_dat_bus a, (select * from t_bill_detail where bill_type = 3 and oper_type = 2 and isnull(re_23, '') = '') b
		where a.billno = convert(nvarchar(25), b.Bill_No) and a.checkstatus = '1' 
	  
	declare @trankey varchar(32)
	declare @nowbillno int
	declare @tranamount decimal(15, 2)
	declare @relaid int
	declare @cnt int
	
	declare @saleamount decimal(15, 2)
  declare @salecount int
          
	declare tc cursor for select a.newbillno nowbillno, a.trankey, a.tranamount from #tmp_detail_xj a
  
  open tc
  
  fetch next from tc into @nowbillno, @trankey, @tranamount
  
  while @@FETCH_STATUS = 0
  begin
  	select @relaid = relaid from t_dat_rela_bill where billno = @nowbillno
	  
	  if (@relaid is not null)
	  begin
	  	update t_dat_bus set nowbillno = @nowbillno where trankey = @trankey
	  	
	  	delete from t_dat_rela_sale where relaid = @relaid
	  	
		  insert into t_dat_rela_sale (relaid, trankey, tranamount, billno) 
		    select @relaid, trankey, tranamount, nowbillno from t_dat_bus where nowbillno = @nowbillno
		    
		  select @saleamount = isnull(sum(tranamount), 0), @salecount = count(*) from t_dat_rela_sale where relaid = @relaid 
          
      update t_dat_rela set saleamount = @saleamount, salecount = @salecount, saledate = getdate() where relaid = @relaid
		end
		
	  fetch next from tc into  @nowbillno, @trankey, @tranamount
  end
  
  close tc
  deallocate tc
  
end




